INSERT INTO `bk_banner` VALUES (1,'20201211_banner_calon_dosen_konselor.jpg',1,'The World Health Organization describes mental well-being as a state of well-being in which the individual realizes his or her own abilities, can cope with the normal stresses of life, can work productively and fruitfully, and is able to make a contribution to his or her community. ','\" The World Health Organization describes mental well-being as a state of well-being in which the individual realizes his or her own abilities, can cope with the normal stresses of life, can work productively and fruitfully, and is able to make a contribution to his or her community. \"    ',0,'2021-07-26','2021-12-31','2022-12-06 12:50:32',18,'2022-12-06 05:50:32','1'),(3,'20201211_banner_pelatihan_penyesuaian_diri_mahasiswa1.jpg',1,'\" The World Health Organization describes mental well-being as a state of well-being in which the individual realizes his or her own abilities, can cope with the normal stresses of life, can work productively and fruitfully, and is able to make a contribution to his or her community. \"','\" The World Health Organization describes mental well-being as a state of well-being in which the individual realizes his or her own abilities, can cope with the normal stresses of life, can work productively and fruitfully, and is able to make a contribution to his or her community. \"',1,NULL,NULL,'2022-12-06 12:50:32',18,'2022-12-06 05:50:32','1'),(4,'20201211_banner_calon_dosen_konselor_21.jpg',1,'\" The World Health Organization describes mental well-being as a state of well-being in which the individual realizes his or her own abilities, can cope with the normal stresses of life, can work productively and fruitfully, and is able to make a contribution to his or her community. \"','\" The World Health Organization describes mental well-being as a state of well-being in which the individual realizes his or her own abilities, can cope with the normal stresses of life, can work productively and fruitfully, and is able to make a contribution to his or her community. \"',1,NULL,NULL,'2022-12-06 12:50:32',18,'2022-12-06 05:50:32','1'),(6,'20210107_banner_bkslide.png',1,'Tes Kepribadian OMNI TINGGAL 2 HARI LAGI segera lakukan pengisian sebelum ditutup.','Tes Kepribadian OMNI TINGGAL 2 HARI LAGI\nsegera lakukan pengisian sebelum ditutup.\n<br>\nhttps://teskepribadian.id/app/itb\n<br>\nhttps://teskepribadian.id/app/itb\n<br>\nhttps://teskepribadian.id/app/itb\n<br>\nTerima kasih',1,NULL,NULL,'2022-12-06 12:50:32',18,'2022-12-06 05:50:32','1'),(9,'20210203_banner_Tes_Psikotes_Susulan_13-14_feb_2021.jpeg',1,'Psikotes Susulan pada hari Sabtu-Minggu, tanggal 13-14 Februari 2021.','Sehubungan dengan adanya kendala yang dihadapi oleh Mahasiswa Baru ITB angkatan 2020 pada saat mengikuti Psikotes Online pada periode September-Oktober lalu, maka ITB akan melaksanakan Psikotes Susulan pada hari Sabtu-Minggu, tanggal 13-14 Februari 2021. \n\nUntuk mahasiswa yang akan mengikuti Psikotes Susulan, harap melakukan daftar ulang pada tautan dibawah ini sampai dengan paling lambat hari Minggu, 7 Februari 2021:\n\nhttp://bit.ly/DaftarUlangPsikotesITB\n',1,NULL,NULL,'2022-12-06 12:50:32',18,'2022-12-06 05:50:32','1'),(10,'20210216_banner_tes_psikotes_susulan_kembali.jpeg',1,'Informasi Tes psikotes susulan periode 13 - 14 Februari 2021','Bagi mahasiswa baru angkatan 2020, yang belum mengikuti tes psikotes susulan periode 13 - 14 Februari 2021 lalu, maka ITB melaksanakan :\n\n\nPsikotes Susulan Kembali\nSabtu, 20 Februari 2021\n\n\nWaktu pendaftaran sampai dengan hari Kamis, 18 Februari 2021, harap melakukan daftar ulang kembali pada tautan dibawah ini :\n\n\nhttp://bit.ly/DaftarUlangPsikotesITB\n\n\nPastikan alamat email yang dicantumkan benar, Jangan lewatkan kesempatan terakhir untuk lebih mengenal potensi diri\n\n\n\n\n',1,NULL,NULL,'2022-12-06 12:50:32',18,'2022-12-06 05:50:32','1'),(11,'20210507_banner_32F25A59-6DBC-4CA4-9383-C9679BA0A6AE.jpeg',1,'Sehubungan dengan Hari Raya Idul Fitri seluruh kegiatan pelayanan Bimbingan Konseling ITB Diliburkan','Sehubungan dengan Hari Raya Idul Fitri\nseluruh kegiatan pelayanan Bimbingan Konseling ITB\nDiliburkan mulai tanggal 12 hingga 14 Mei 2021\nuntuk layanan darurat tetap kami layani\nkegiatan pelayanan Bimbingan Konseling ITB akan kembali aktif pada 17 Mei 2021\natas perhatian dan kerjasama kami ucapkan terimakasih',1,NULL,NULL,'2022-12-06 12:50:32',18,'2022-12-06 05:50:32','1'),(12,'20210715_banner_Informasi_Awal_Tes_Psikologi_untuk_calon_mahasiswa_baru_ITB_2021.jpg',1,'Informasi Awal Tes Psikologi untuk calon mahasiswa baru ITB 2021','Informasi Awal Tes Psikologi untuk calon mahasiswa baru ITB 2021\n\nSelamat kepada seluruh calon mahasiswa baru ITB 2021. Sebagai bagian dari kegiatan penerimaan mahasiswa baru (PMB) akan dilakukan pemetaan potensi melalui tes psikologi. Tes ini akan dilaksanakan mulai tanggal 21 Juli 2021 oleh ITB bekerja sama dengan Pusat Inovasi Psikologi (PIP) Unpad. Pemetaan potensi ini penting untuk diikuti, karena datanya dapat digunakan untuk membantumu memahami potensi diri agar optimal dalam proses belajar di ITB. Langkah pertama yang perlu dilakukan adalah melakukan registrasi dengan mengisi form pendaftaran berikut, paling lambat hari Jumat tanggal 16 Juli 2021: \n\nbit.ly/PendaftaranTesPsikologiITB2021\n\nInfo penting terkait jadwal dan alur pelaksanaan psikotes dapat dilihat pada link berikut:\nhttps://bit.ly/InformasiAwalTesPsikologiITB',1,'2021-07-20','2021-07-22','2022-12-06 12:50:32',18,'2022-12-06 05:50:32','1'),(14,'20210720_banner_poster_ucapan_idul_adha.jpg',1,'Hari Raya Idul Adha 1442 H','   ',1,'2021-07-20','2021-07-22','2022-12-06 12:50:32',18,'2022-12-06 05:50:32','1'),(16,'20211028_banner_WhatsApp_Image_2021-10-28_at_09_50_15.jpeg',1,'[ Lomba TikTok Kesehatan Mental ITB ]','<p><br></p><p>Ayo ikuti Lomba TikTok Kesehatan Mental ITB. Perhatikan persyaratan di bawah ini ya:<br></p><p>Tema : Kesehatan Mental Mahasiswa (dalam rangka memperingati Hari Kesehatan Mental Dunia, 10 Oktober 2021)</p><p>Durasi : 60 – 90&nbsp; detik degan format MP4 dan minimal 720P</p><p>Waktu Pengumpulan : 10 Oktober 2021 – 05 November 2021</p><p>Link informasi, pendaftaran, dan pengumpulan video:</p><p><a href=\"https://bit.ly/tiktokkesehatanmentalitb\" target=\"_blank\" style=\"font-weight: bold; background-color: rgb(0, 0, 255);\">https://bit.ly/tiktokkesehatanmentalitb</a><br></p>  ',1,'2021-10-10','2021-11-05','2022-12-06 12:50:32',0,'2022-12-06 05:50:32','1'),(17,'20211014_banner_D2459C9D-CCB0-4B8F-A394-9C6F491EAC33.jpeg',1,'Webinar dan Talkshow','<p>SAATNYA MAHASISWA MULAI CURHATIN MASALAH MENTAL</p><p><br></p><p>Adakah diantara kamu yang belum tahu, kalau ternyata perguruan tinggi memiliki layanan konseling dan GRATIS? Atau kamu sedang bingung, mau curhat tentang masalah kesehatan mental di kampus tapi takut di cap sebagai orang \"aneh\"?</p><p><br></p><p>Temukan jawabannya di...</p><p><br></p><p>TEMANI TEMAN FEST</p><p>Festival kesehatan mental yang diadakan oleh Klik.Klas dan berkolaborasi dengan ganara art dan #JejaringMenangBersama</p><p><br></p><p>Dalam sesi webinar dan talkshow \"Saatnya Mahasiswa Mulai Curhatin Masalah Mental\" bersama :</p><p><br></p><p>1. Ir. Hendri Syamsudin M.Sc.,Ph.D (Kasubdit Bimbingan Konseling ITB)</p><p>2. Idei Khurnia Swasti, M.Psi., Psikolog (Tim Konseling Fakultas Psikologi UGM, Dosen Fakultas Psikologi UGM)</p><p>3. dra. Sugiarti, M.Kes, Psikolog (Psikolog di Klinik Satelt UI Makara, Dosen Fakultas Psikologi UI)</p><p>4. Rezki A S, S.Psi., M.Psi., Psikolog (Staf Pengajar di Fakultas Psikologi UNPAD)</p><p><br></p><p>Sesi ini akan dilaksanakan pada :</p><p>16 Oktober 2021</p><p>09.00 - 11.30 WIB</p><p>Via Zoom</p><p><br></p><p>Daftarkan dirimu di :</p><p>www.temaniteman.net atau bisa langsung melalui link bit.ly/temanitemanfest</p><p><br></p><p>Acara ini bersifat GRATIS dan dapatkan E-SERTIFIKAT serta DOORPIZE</p><p><br></p><p>Ajakin teman-temanmu ya...&nbsp;</p><p>Bersama #TemaniTeman kita jaga kesehatan mental</p><p><br></p><p>#klikklas #SelaluBertumbuh #TemaniTeman #TemaniTemanFest #Ganaraart #JejaringMenangBersama #KesehatanMental #PeduliMental #SehatMental #Kampus</p>',1,'2021-10-14','2021-10-17','2022-12-06 12:50:32',0,'2022-12-06 05:50:32','1'),(18,'20211019_banner_75C3482C-B6DA-4787-9482-CE5153FC839B.jpeg',1,'[EMPOWERING WOMEN IN THE SOCIETY NATIONAL COMPETITION 2021] ','<p><br></p><p>Halo generasi muda!?</p><p>UKM LKIMB UNM membuka kesempatan bagi kalian yang ingin berpartisipasi dalam lomba esai dan poster dengan tema: *\"Kekerasan dan Pelecehan Seksual terhadap Perempuan di Ranah Publik maupun Privat\"*</p><p><br></p><p>*Simak dan catat tanggalnya*</p><p>TIMELINE LOMBA ESAI:&nbsp;</p><p>- Pendaftaran dan pengumpulan karya: 20 Oktober - 7 November 2021</p><p>- Penilaian Karya: 8-13 November 2021</p><p>- Pengumuman finalis: 14 November 2021</p><p>- Pengumpulan PPT finalis: 16-22 November 2021</p><p>- Technical Meeting: 23 November 2021</p><p>- Presentasi Esai dan Pengumuman Juara: 25 November 2021&nbsp;</p><p><br></p><p>TIMELINE LOMBA POSTER:</p><p>- Pendaftaran dan pengumpulan karya: 20 Oktober -7 November 2021</p><p>- Penilaian karya : 08-24 November 2021</p><p>- Pengumuman pemenang : 25 November 2021</p><p><br></p><p>Simak Link Pendaftaran dan Panduannya di https://linktr.ee/Ruangtemuperempuan</p><p><br></p><p>Jadi, tunggu apalagi? Yuk daftarkan dirimu dan kirimkan karya terbaik kalian ke email kami di ruteperempuan@gmail.com????&nbsp;</p><p><br></p><p>Narahubung:</p><p>+62 858-2474-0608 (Nurul Ishma)</p><p>+62 823-4704-3297 (Alhijratul)&nbsp;</p><p><br></p><p>Pantau terus akun media sosial kami</p><p>IG: @ruangtemu_perempuan dan @lkimbunm94</p><p>Youtube: PLURALisME Project</p><p><br></p><p>#EmpoweringWomenInTheSociety</p><p>#HarmonyInDiversity #MariBerLKIMB</p>   ',1,'2021-10-19','2021-11-07','2022-12-06 12:50:32',0,'2022-12-06 05:50:32','1'),(19,'20211102_banner_WhatsApp_Image_2021-11-02_at_09_59_58.jpeg',1,'[Talkshow Kementerian EPKM x Ditmawa ITB]','<p>Sudahkah aku menerima diriku, kekurangan dan kelebihanku, sepenuh dan setulusnya<br></p><p>____</p><p><br></p><p>Kementerian EPKM Kabinet ‘Akar Asa’ KM ITB 2021/2022 berkolaborasi dengan Direktorat Kemahasiswaan ITB, mempersembahkan:</p><p><br></p><p>Talkshow “CARE”The Power of Self-Acceptance</p><p>Tanggal&nbsp; &nbsp; Minggu, 7 November 2021</p><p>Waktu&nbsp; &nbsp; &nbsp; &nbsp;13:00 - 15:25 WIB</p><p>Tempat&nbsp; &nbsp; &nbsp;Zoom Meeting</p><p><br></p><p>Pembicara:</p><p>1. Dr.dr.Veranita Pandia, Sp.KJ., M.Kes. (Kepala Departemen Ilmu Kedokteran Jiwa RS Hasan Sadikin Bandung)</p><p><br></p><p>2. Dra. Isriana, Psikolog&nbsp;</p><p>(Bimbingan Konseling ITB)</p><p><br></p><p>Moderator:</p><p>Elnaya Mahadevi Pillian&nbsp;</p><p>(Dirjen Platform dan Relasi Kementerian EPKM)</p><p><br></p><p>Terbuka untuk mahasiswa/i ITB dan massa umum.</p><p>Tersedia E-certificate</p><p><br></p><p>Segera registrasi!! Gratis!!</p><p><a href=\"http://www.kmitb.xyz/TalkshowCARExDitmawaITB\" target=\"_blank\" style=\"background-color: rgb(247, 247, 247); color: rgb(74, 123, 140);\">www.kmitb.xyz/TalkshowCARExDitmawaITB</a></p><p><a href=\"http://www.kmitb.xyz/TalkshowCARExDitmawaITB\" target=\"_blank\" style=\"color: rgb(8, 82, 148); background-color: rgb(247, 247, 247);\">www.kmitb.xyz/TalkshowCARExDitmawaITB</a></p><p><a href=\"http://www.kmitb.xyz/TalkshowCARExDitmawaITB\" target=\"_blank\" style=\"color: rgb(8, 82, 148); background-color: rgb(247, 247, 247);\">www.kmitb.xyz/TalkshowCARExDitmawaITB</a></p><p><span style=\"background-color: rgb(247, 247, 247);\"><br></span></p><p><span style=\"background-color: rgb(247, 247, 247);\">????Contact Person:</span></p><p><span style=\"background-color: rgb(247, 247, 247);\">Ruth (081310221039)</span></p><p><span style=\"background-color: rgb(247, 247, 247);\"><br></span></p><p><span style=\"background-color: rgb(247, 247, 247);\">More info:</span></p><p><a href=\"http://www.instagram.com/ganeshamentalcare\" target=\"_blank